import React, { Component } from 'react';

export class Form extends Component {
    render() {
        return (
            <div className="wrapper">
                <div className="row">
                    <div className="col-md-6">
                        <h2>Get in Touch</h2>
                    </div>
                </div>
            </div>
        );
    }
}

export default Form;
